import { Map, GoogleApiWrapper } from 'google-maps-react';


 const MapContainer = (props) => {return (
      <Map
        google={this.props.google}
        zoom={14}
        style={{width: '100%',
        height: '100%'}}
        initialCenter={
          {
            lat: -1.2884,
            lng: 36.8233
          }
        }
      />
    );
  }


